 built environment.\n  The firm’s long-established history of globally recognized icons such the Burj Khalifa\n  in Dubai, as well as transformative New York City projects such as Lever House,\n  the new One World Trade Center and Time Warner Center, underscore its reputation\n  for exceptional design and creativity.  By analyzing clients’ goals and synthesizing\n  design and technical coordination, the firm creates spaces that are cutting-edge,\n  distinctive, and functional.</p><p>SOM was twice named AIA Firm of the Year and\n  its projects have won over 1,700 awards, including five AIA 25-year Awards.</p>\"\ncreated_at: 2014-07-28 20:29:49.000000000 Z\nupdated_at: 2014-09-05 13:39:44.000000000 Z\nsection_type: \n',NULL,'2014-10-18 09:49:48','2014-10-18 09:49:48'),(64,'co-op@252e57.com','changed','VideoSection',1,'Skidmore, Owings & Merrill',NULL,'---\nid: 1\nsection: Design Architect\ntitle: Skidmore, Owings & Merrill\nbody: \"<p>A leading international architecture, urban design and planning, engineering,\n  and interior architecture firm, Skidmore, Owings & Merrill LLP (SOM) is recognized\n  for excellence and innovation that enhance the quality of the built environment.\n  The firm’s long-established history of globally recognized icons such the Burj Khalifa\n  in Dubai, as well as transformative New York City projects such as Lever House,\n  the new One World Trade Center and Time Warner Center, underscore its reputation\n  for exceptional design and creativity.  By analyzing clients’ goals and synthesizing\n  design and technical coordination, the firm creates spaces that are cutting-edge,\n  distinctive, and functional.</p><p>SOM was twice named AIA Firm of the Year and\n  its projects have won over 1,700 awards, including five AIA 25-year Awards.</p>\"\ncreated_at: 2014-07-28 20:29:49.000000000 Z\nupdated_at: 2014-09-05 13:39:44.000000000 Z\nsection_type: \n',NULL,'2014-10-18 09:54:51','2014-10-18 09:54:51'),(65,'co-op@252e57.com','changed','VideoSection',1,'Skidmore, Owings & Merrill',NULL,'---\nid: 1\nsection: Design Architect\ntitle: Skidmore, Owings & Merrill\nbody: \"<p>A leading international architecture, urban design and planning, engineering,\n  and interior architecture firm, Skidmore, Owings & Merrill LLP (SOM) is recognized\n  for excellence and innovation that enhance the quality of the built environment.\n  The firm’s long-established history of globally recognized icons such the Burj Khalifa\n  in Dubai, as well as transformative New York City projects such as Lever House,\n  the new One World Trade Center and Time Warner Center, underscore its reputation\n  for exceptional design and creativity.  By analyzing clients’ goals and synthesizing\n  design and technical coordination, the firm creates spaces that are cutting-edge,\n  distinctive, and functional.</p><p>SOM was twice named AIA Firm of the Year and\n  its projects have won over 1,700 awards, including five AIA 25-year Awards.</p>\"\ncreated_at: 2014-07-28 20:29:49.000000000 Z\nupdated_at: 2014-10-18 09:57:47.415241908 Z\nsection_type: designteam\n',NULL,'2014-10-18 09:57:47','2014-10-18 09:57:47'),(66,'co-op@252e57.com','changed','VideoSection',2,'Daniel Romualdez',NULL,'---\nid: 2\nsection: Interior Architect\ntitle: Daniel Romualdez\nbody: \"<p>Architect and designer Daniel Romualdez is globally renowned within an elite\n  group of tastemakers and business leaders for the creation of exquisitely sophisticated\n  interiors. After coming to the United States to study at Yale and Columbia University,\n  Romualdez worked for architectural luminaries Thierry Despont and Robert A.M. Stern\n  before establishing his own eponymous firm in Manhattan in 1993. Called “a connoisseur\n  with tremendous range” by architecture critic Paul Goldberger of The New Yorker,\n  Romualdez is known for interior design that deftly juxtaposes humble and fine materials,\n  elegantly integrating classical style with modern influences. Named to Architectural\n  Digest’s prestigious AD100 list, Romualdez has also been profiled by leading international\n  publications including Vogue, The Wall Street Journal, and Departures.</p>\"\ncreated_at: 2014-07-28 20:29:50.000000000 Z\nupdated_at: 2014-10-18 09:57:52.298634410 Z\nsection_type: designteam\n',NULL,'2014-10-18 09:57:52','2014-10-18 09:57:52'),(67,'co-op@252e57.com','changed','VideoSection',3,'SLCE',NULL,'---\nid: 3\nsection: Architect of Record\ntitle: SLCE\nbody: \"<p>Founded in New York City in 1941, SLCE Architects, LLP is one of the most\n  prolific firms in the metropolitan area and enjoys a growing presence nationally.\n  As Architect of Record, SLCE has collaborated with many internationally renowned\n  design including Atelier Jean Nouvel, Norman Foster & Partners, Robert A.M. Stern\n  Architects, Renzo Piano Workshop, Herzog de Meuron Architects, Skidmore Owings &\n  Merrill, and Santiago Calatrava Arquitecto. SLCE’s New York City luxury condominium\n  projects include 15 Central Park West, Beacon Court, 10 UN Plaza, 255 East 74th\n  Street and The Milan.</p>\"\ncreated_at: 2014-07-28 20:29:50.000000000 Z\nupdated_at: 2014-10-18 09:57:58.181172976 Z\nsection_type: designteam\n',NULL,'2014-10-18 09:57:58','2014-10-18 09:57:58'),(68,'co-op@252e57.com','changed','VideoSection',4,'WSP',NULL,'---\nid: 4\nsection: Sustainable Engineer\ntitle: WSP\nbody: \"<p>Founded in 1969, WSP is the mechanical engineering business of WSP, one\n  of the world’s leading engineering and design consultancies with more than 300 offices,\n  across 30 countries. The firm provides sustainable consulting in the built and natural\n  environment across a wide range of market sectors, including residential, retail,\n  hotels and resorts, and cultural institutions, among many others. WSP, which specializes\n  in the residential sector, offers multi-disciplinary expertise in all areas of planning,\n  from design and construction to building engineering and environmental consultancy\n  for large and complex projects. High-profile properties the firm has consulted for\n  in New York City include New York by Gehry, The Plaza Hotel & Residences, Time Warner\n  Center, Trump Tower, Trump International Hotel & Tower, MoMA Tower, and 15 Central\n  Park West.</p>\"\ncreated_at: 2014-07-28 20:29:50.000000000 Z\nupdated_at: 2014-10-18 09:58:02.775880926 Z\nsection_type: designteam\n',NULL,'2014-10-18 09:58:02','2014-10-18 09:58:02');
