  `outdoor_sq_ft` float DEFAULT NULL,
  `outdoor_sq_m` float DEFAULT NULL,
  `common_charges` float DEFAULT NULL,
  `monthly_total` float DEFAULT NULL,
  `pilot` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
