  `plan_file_name` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `plan_content_type` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `plan_file_size` int(11) DEFAULT NULL,
  `plan_updated_at` datetime DEFAULT NULL,
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `balcony` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=92 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;
