INSERT INTO `video_sections` VALUES (1,'Design Architect','Skidmore, Owings & Merrill','<p>A leading international architecture, urban design and planning, engineering, and interior architecture firm, Skidmore, Owings & Merrill LLP (SOM) is recognized for excellence and innovation that enhance the quality of the built environment. The firm’s long-established history of globally recognized icons such the Burj Khalifa in Dubai, as well as transformative New York City projects such as Lever House, the new One World Trade Center and Time Warner Center, underscore its reputation for exceptional design and creativity.  By analyzing clients’ goals and synthesizing design and technical coordination, the firm creates spaces that are cutting-edge, distinctive, and functional.</p><p>SOM was twice named AIA Firm of the Year and its projects have won over 1,700 awards, including five AIA 25-year Awards.</p>','2014-07-28 20:29:49','2014-10-18 09:57:47','designteam'),(2,'Interior Architect','Daniel Romualdez','<p>Architect and designer Daniel Romualdez is globally renowned within an elite group of tastemakers and business leaders for the creation of exquisitely sophisticated interiors. After coming to the United States to study at Yale and Columbia University, Romualdez worked for architectural luminaries Thierry Despont and Robert A.M. Stern before establishing his own eponymous firm in Manhattan in 1993. Called “a connoisseur with tremendous range” by architecture critic Paul Goldberger of The New Yorker, Romualdez is known for interior design that deftly juxtaposes humble and fine materials, elegantly integrating classical style with modern influences. Named to Architectural Digest’s prestigious AD100 list, Romualdez has also been profiled by leading international publications including Vogue, The Wall Street Journal, and Departures.</p>','2014-07-28 20:29:50','2014-10-18 09:57:52','designteam'),(3,'Architect of Record','SLCE','<p>Founded in New York City in 1941, SLCE Architects, LLP is one of the most prolific firms in the metropolitan area and enjoys a growing presence nationally. As Architect of Record, SLCE has collaborated with many internationally renowned design including Atelier Jean Nouvel, Norman Foster & Partners, Robert A.M. Stern Architects, Renzo Piano Workshop, Herzog de Meuron Architects, Skidmore Owings & Merrill, and Santiago Calatrava Arquitecto. SLCE’s New York City luxury condominium projects include 15 Central Park West, Beacon Court, 10 UN Plaza, 255 East 74th Street and The Milan.</p>','2014-07-28 20:29:50','2014-10-18 09:57:58','designteam'),(4,'Sustainable Engineer','WSP','<p>Founded in 1969, WSP is the mechanical engineering business of WSP, one of the world’s leading engineering and design consultancies with more than 300 offices, across 30 countries. The firm provides sustainable consulting in the built and natural environment across a wide range of market sectors, including residential, retail, hotels and resorts, and cultural institutions, among many others. WSP, which specializes in the residential sector, offers multi-disciplinary expertise in all areas of planning, from design and construction to building engineering and environmental consultancy for large and complex projects. High-profile properties the firm has consulted for in New York City include New York by Gehry, The Plaza Hotel & Residences, Time Warner Center, Trump Tower, Trump International Hotel & Tower, MoMA Tower, and 15 Central Park West.</p>','2014-07-28 20:29:50','2014-10-18 09:58:02','designteam'),(5,'','World Wide Group','<p>World Wide Group is a Manhattan based developer of luxury residential properties. Since the 1970s, World Wide has developed over $7 billion of condominium and multifamily homes. World Wide’s properties are widely known for exceptional aesthetic integrity, incorporating thoughtful design, functionality, and sustainability.</p><p>A sixty year old private partnership led by Victor Elmaleh and Jim Stanton, World Wide Group is proud to be the steward of its long-standing reputation for quality and innovation.</p><p>To learn more about World Wide, please visit our corporate website at <a href=\"http://wwgny.com/\" target=\"_blank\">WWGNY.COM</a>.</p>',NULL,NULL,'developteam'),(6,'','Rose Associates','<p>Based in New York, Rose Associates is a developer, owner, and operator of prominent residential properties. The firm focuses on creating enduring, long-term relationships, making decisions based on years of successful ownership experience. Rose’s emphasis on creating capital value has been the foundation of lasting associations with prominent financial institutions and real estate investors.</p><p>As an equity partner, Rose offers full-service pre-development and development responsibility from the initial concept to the last finishing detail. The firm leverages skills in finance, planning, construction, project administration, marketing, and property management with the talents of innovative designers, consultants, and planners. Rose oversees more than 26,000 units across New York, with approximately $2 billion in projects under development.</p>',NULL,NULL,'developteam');
